import React from 'react';
import '../App.css';

function LoginForm() {
  function submitLogin(e) {
    e.preventDefault();
  }

  return (
    <form className='login'>
      <input type='email' name='email' />
      <input type='password' name='password' />
      <button className='filledBtn' onClick={submitLogin}>
        Login
      </button>
    </form>
  );
}

export default LoginForm;
